import React from 'react';


function Cal(){
var a=12;
var b=42;
 

var sum =(a+b);
var dev =(a/b);
var mul =(a*b);
var sub =(a-b);

return <>
 <h1>
     Addtion is ::
     {sum}</h1>
  
 <h1> Subtraction is ::{sub}</h1>
 
 <h1> multih1lication is::{mul}</h1>
    
 <h1>
     Division is ::{dev}</h1>
</>;




}

export default Cal;
